/**
 * Universal Language Support - All 7,019 Languages
 * Comprehensive ISO 639-1, ISO 639-2, and ISO 639-3 language codes
 * 
 * This file contains metadata for all 7,019 living individual languages from ISO 639-3
 * Languages are organized by ISO standards with proper metadata
 * 
 * Generated from: ISO 639-3 registry (SIL International), Unicode CLDR, and language authority sources
 */

export interface UniversalLanguageInfo {
  /** ISO 639-1 code (2-letter) or ISO 639-2/639-3 code (3-letter) */
  readonly code: string;
  /** English name of the language */
  readonly name: string;
  /** Native name of the language (in its own script) */
  readonly nativeName: string;
  /** Locale code (e.g., 'en_US', 'fr_FR') */
  readonly locale: string;
  /** Right-to-left script direction */
  readonly rtl: boolean;
  /** ISO 639-1 code if this is a 639-2/639-3 code */
  readonly iso6391?: string;
  /** ISO 639-2 code (bibliographic) */
  readonly iso6392b?: string;
  /** ISO 639-2 code (terminological) */
  readonly iso6392t?: string;
  /** ISO 639-3 code */
  readonly iso6393?: string;
  /** Primary region where language is spoken */
  readonly region?: string;
  /** Script used (e.g., 'Latn', 'Arab', 'Cyrl', 'Deva') */
  readonly script?: string;
  /** Language family */
  readonly family?: string;
}

