/**
 * Get all language codes (7,019 languages)
 */
export function getAllUniversalLanguageCodes(): string[] {
  return Object.keys(UNIVERSAL_LANGUAGES).sort();
}

/**
 * Get language info by code
 */
export function getUniversalLanguageInfo(code: string): UniversalLanguageInfo | undefined {
  return UNIVERSAL_LANGUAGES[code.toLowerCase()];
}

/**
 * Get all RTL languages
 */
export function getAllRTLLanguages(): string[] {
  return Object.values(UNIVERSAL_LANGUAGES)
    .filter(lang => lang.rtl)
    .map(lang => lang.code);
}

/**
 * Check if a language code is RTL
 */
export function isRTLLanguage(code: string): boolean {
  const lang = getUniversalLanguageInfo(code);
  return lang?.rtl ?? RTL_LANGUAGE_CODES.has(code.toLowerCase());
}

/**
 * Get languages by script
 */
export function getLanguagesByScript(script: string): UniversalLanguageInfo[] {
  return Object.values(UNIVERSAL_LANGUAGES)
    .filter(lang => lang.script === script);
}

/**
 * Get languages by family
 */
export function getLanguagesByFamily(family: string): UniversalLanguageInfo[] {
  return Object.values(UNIVERSAL_LANGUAGES)
    .filter(lang => lang.family === family);
}

/**
 * Validate language code
 */
export function isValidLanguageCode(code: string): boolean {
  return code in UNIVERSAL_LANGUAGES;
}

/**
 * Get ISO 639-1 code from any ISO code
 */
export function getISO6391Code(code: string): string | undefined {
  const lang = getUniversalLanguageInfo(code);
  return lang?.iso6391 ?? lang?.code;
}

/**
 * Get locale code for a language
 */
export function getLocaleCode(code: string): string {
  const lang = getUniversalLanguageInfo(code);
  return lang?.locale ?? `${code}_${code.toUpperCase()}`;
}

